function GridBox(){
    return(<div className="grid">
<div>
<img src={vishal} style={{width:"300px",height:"16em"}} alt=""/>
</div>
<div className="messages">
 <div className="firstmessage">
 <Badge bg="dark" className="wave"> 
 <WavingHandIcon/>
 &nbsp;
 Visitors I m Vishal</Badge>
 </div>
      <div className="seconfmessage">
        Vishnuj756@gmail.com
      </div>
</div>
    </div>)
}
export default GridBox;
